#Use to import pandas
import pandas as pd
import seaborn as sns
import matplotlib.pyplot as plt

#Use to import the file into google Colab drive
from google.colab import files 
#Use to import io, which opens the file from the Colab drive
import io

"""***files.upload() irá abrir uma janela para a escolha do arquivo .csv ***

---


"""

uploaded = files.upload()
arquivo = next(iter(uploaded)) 
arquivo

"""**Leitura de dados contido no arquivo**

---


"""

gfile_name = io.StringIO(uploaded[arquivo].decode('ISO 8859-1').strip())
dados = pd.read_csv(gfile_name,sep=';')
dados

"""**NOMES DAS COLUNAS NO ARQUIVO .csv**

---


"""

print(dados.columns.ravel())

"""**EXTRAÇÃO DE DADOS DE UMA COLUNA  E CALCULANDO A MÉDIA**

---


"""

#calculando a média de idade
media_idade = dados['idade'].mean()
print("media de idade: %.2f " %media_idade)

"""**SOMA DAS IDADES**

---


"""

soma_idades = dados['idade'].sum()
print("soma das idades: %.2f " %soma_idades)

"""**MAIOR IDADE**

---


"""

maior_idade = dados['idade'].max()
print("maior das idades: %.2f " %maior_idade)

"""**MENOR IDADE**

---


"""

menor_idade = dados['idade'].min()
print("menor das idades: %.2f " %menor_idade)

"""**DESVIO PADRÃO DAS IDADES**

---


"""

desvio_idade = dados['idade'].std()
print("Desvio Padrão das Idades: %.2f " %desvio_idade)

"""**VARIÂNCIA DAS IDADES**

---


"""

variancia_idade = dados['idade'].var()
print("Variância das Idades: %.2f " %variancia_idade)

